import LoginPage from "./components/LoginPage.js";
import AnimeOut from "./components/AnimeOut.js";
import "./App.css";
function App() {

  return (
    <div>
    <div className="logapp">
        <LoginPage/>
    </div>
    <div className="app">
      <AnimeOut/>
    </div>
    </div>
  );
}

export default App;
